                var html_ef921b5dde292e1a011a5a6a63407c45 = $(`<div id="html_ef921b5dde292e1a011a5a6a63407c45" style="width: 100.0%; height: 100.0%;">         <div style='font-family: Arial, sans-serif; width: 260px; color: #333;'>             <h3 style='color: #008000; margin-bottom: 0; font-size: 16px;'>Informaci√≥n del Hecho</h3>             <hr style='border: 0; border-top: 1px solid #ccc; margin: 5px 0 10px 0;'>             <table style='width: 100%; font-size: 12px; border-collapse: collapse;'>                 <tr><td style='padding: 2px;'><b>Fecha:</b></td><td>2026-01-30 00:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Hora:</b></td><td>22:30:00</td></tr>                 <tr><td style='padding: 2px;'><b>Direcci√≥n:</b></td><td>L. BAUTISTA 3164</td></tr>                 <tr><td style='padding: 2px;'><b>Tipo:</b></td><td>ROBO AGRAVADO  (uso de armas de fuego) - Art.166 Inc.2¬∫ p√°rr. 2do</td></tr>             </table>             <div style='margin-top: 10px;'>                 <b style='font-size: 12px;'>Detalle del Hecho:</b>                 <div style='margin-top: 5px; padding: 10px; border: 1px solid #aaa; background-color: #f9f9f9;                              font-style: italic; font-size: 11px; max-height: 100px; overflow-y: auto; line-height: 1.4;'>                     "Refiere que, en el dia de la fecha, siendo aproximadamente las 23:00 horas, se hace presente en esta seccional el Sr. Mansilla Marcelo Javier.Que su hijo resulta ser propietario de un vehiculo marca Mercadez Benz modelo C200 EDITION C tipo sedan 4 puertas color gris metalizado, dominios colocados OIF803, a√±o de fabricacion 2014 combustible a nafta, motor numero 27186030719108 y numero de chasis WDDGF4JB7EG233429, desde el a√±o 2014 . Refiere que el dia 30 de enero de 2026, siendo aproximadamente las 22:30 horas, se encontraba en el domicilio de su amigo Brian Caramelo, sito en calle Bautista N.¬∫ 3464, donde se hallaba compartiendo un asado junto  a integrantes del club. Que, en un momento dado, al comenzar a comer, se percata de que habia olvidado descender de su vehiculo el pan que habia comprado, motivo por el cual sale por la puerta principal del domicilio y se dirige hacia su automovil. Al abrir la puerta del lado del acompa√±ante e inclinarse para tomar el mencionado elemento, siente la presencia de una persona a su espalda, quien le habla y le pregunta si su auto era un Mercedes. Que, al darse vuelta, creyendo que se trataba de uno de los presentes, observa que no era asi, visualizando en ese momento a dos masculinos, uno de los cuales se encontraba armado con un arma de fuego tipo revolver. Los mismos se movilizaban en una motocicleta tipo enduro, la cual poseia el tanque de color blanco, encontrandose uno de los sujetos a bordo del rodado y el otro de pie, quien lo apuraba exigiendole que entregue sus pertenencias. Describe que uno de los masculinos vestia campera de equipo de futbol, mientras que el restante llevaba campera gris, sin casco, con visera blanca y capucha negra. Que acto seguido, el masculino armado le arranca una cadena de oro que llevaba puesta y, a viva voz, le ordena que se baje del vehiculo. Que, al sujetarse del auto, el agresor advierte que tambien llevaba colocado un anillo de oro, el cual le exige de manera exaltada, solicitandole ademas la billetera, manifestandole el denunciante que no la tenia en su poder. Finalmente, ante la situacion de intimidacion, procede a entregar las llaves de su automovil, retirandose luego los masculinos del lugar. Por lo cual yo procedo a advertirles a mis amigos de lo ocurrido,momentos posteriores los mismos me acompa√±an a la comisaria jurisdiccional a realizar la correspondiente denuncia. - Consultado para que manifieste si posee la documentacion del rodado, exhibe: Registro de conducir, cedula verde a nombre del hijo el se√±or De Olivera Javier Antonio, y tarjeta de seguro del rodado de compa√±ia La caja. Preguntado si el vehiculo posee sistema de alarma y/o cierre centralizado, trabas volantes, corta corriente refiere que si,. Consultado si habitualmente deja el rodado estacionado en ese lugar, refiere que es la primera vez. Preguntado si recuerda cuanto combustible tenia manifiesta que medio tanque. Consultado por si el vehiculo posee alguna caracteristica particular, refiere que tiene una calcomania del club Juventus en el baul y la de Jiujitsu Solum. Consultado para que manifieste cuantas llaves posee y si puede exhibir la/s misma/s refiere que posee tres en total, una la que se llevaron y dos copias mas en la casa.-Preguntado si poseia algun desperfecto mecanico, refiere que no. Consultado si recuerda kilometraje refiere 220.000 km aproximadamente. Consultado si en el interior del rodado poseia algun elemento de valor/personal, refiere: lentes de ver de cerca con marco color negro, un celular Xiaomi Note 11 color dorado con funda trasparente sin chip el cual conectaba con las camaras del vehiculo. Preguntado si habia algun elemento electronico, ya sea rastreable o no, refiere que no. Consultado si posee sistema de rastreo satelital, refiere que no . Preguntado si en el ultimo tiempo lo llevo a algun taller mecanico, manifiesta que no. Preguntado si posee fotografias refiere si y las aporta en este acto. Preguntado para que manifieste si luego del hecho llamo al 911 refiere que no, que vino a la comisaria. Preguntado para que manifieste si sabe de la existencia de testigos refiere que no recuerda. Preguntado para que manifieste si en el lugar se emplazan camaras refiere que no. - Preguntado para que manifieste si el rodado posee equipo de GNC refiere que no. Consultado si sospecha de alguien, informa que no. Preguntado el recorrido que realizo hasta llegar al lugar de la sustraccion refiere que se encontraba en su domicilio sita en calle Bahia Blanca altura catastral 2600, que sale por calle Bahia Blanca hasta Alberti, Alberti dobla hacia la izquierda hasta la rotonda de Champagnat, Champagnat hasta Carballo y Carballo hasta el domicilio donde sucedio el hecho. Preguntado si el rodado posee Vtv y fecha de la ultima vez que realizo refiere: que si y que la realizo en marzo del a√±o 2025. Preguntado ultima vez que realiza service al rodado refiere: que no recuerda - Preguntado para que manifieste si puede aportar descripciones del/los autor/es, manifiesta que solo recuerda  lo antes mencionado. Preguntado para que manifieste si de volver a verlo/s se encuentra en condiciones de reconocerlo/s refiere: que a uno si Preguntado para que manifieste si puede describir el arma utilizada refiere que era un arma de fuego tipo revolver color negro. - Preguntado si producto del hecho sufrio lesiones refiere que no y que tampoco requiere asistencia medica . Seguidamente se le entera y notifica del contenido de los articulos 83 al 88 del CPP. Que dan cuenta de los derechos del denunciante. Sin mas , se da por finalizada la correspondiente denuncia "                 </div>             </div>         </div>         </div>`)[0];

e centralizado, trabas volantes, corta corriente refiere que si,. Consultado si habitualmente deja el rodado estacionado en ese lugar, refiere que es la primera vez. Preguntado si recuerda cuanto combustible tenia manifiesta que medio tanque. Consultado por si el vehiculo posee alguna caracteristica particular, refiere que tiene una calcomania del club Juventus en el baul y la de Jiujitsu Solum. Consultado para que manifieste cuantas llaves posee y si puede exhibir la/s misma/s refiere que posee tres en total, una la que se llevaron y dos copias mas en la casa.-Preguntado si poseia algun desperfecto mecanico, refiere que no. Consultado si recuerda kilometraje refiere 220.000 km aproximadamente. Consultado si en el interior del rodado poseia algun elemento de valor/personal, refiere: lentes de ver de cerca con marco color negro, un celular Xiaomi Note 11 color dorado con funda trasparente sin chip el cual conectaba con las camaras del vehiculo. Preguntado si habia algun elemento electronico, ya sea rastreable o no, refiere que no. Consultado si posee sistema de rastreo satelital, refiere que no . Preguntado si en el ultimo tiempo lo llevo a algun taller mecanico, manifiesta que no. Preguntado si posee fotografias refiere si y las aporta en este acto. Preguntado para que manifieste si luego del hecho llamo al 911 refiere que no, que vino a la comisaria. Preguntado para que manifieste si sabe de la existencia de testigos refiere que no recuerda. Preguntado para que manifieste si en el lugar se emplazan camaras refiere que no. - Preguntado para que manifieste si el rodado posee equipo de GNC refiere que no. Consultado si sospecha de alguien, informa que no. Preguntado el recorrido que realizo hasta llegar al lugar de la sustraccion refiere que se encontraba en su domicilio sita en calle Bahia Blanca altura catastral 2600, que sale por calle Bahia Blanca hasta Alberti, Alberti dobla hacia la izquierda hasta la rotonda de Champagnat, Champagnat hasta Carballo y Carballo hasta el domicilio donde sucedio el hecho. Preguntado si el rodado posee Vtv y fecha de la ultima vez que realizo refiere: que si y que la realizo en marzo del a√±o 2025. Preguntado ultima vez que realiza service al rodado refiere: que no recuerda - Preguntado para que manifieste si puede aportar descripciones del/los autor/es, manifiesta que solo recuerda  lo antes mencionado. Preguntado para que manifieste si de volver a verlo/s se encuentra en condiciones de reconocerlo/s refiere: que a uno si Preguntado para que manifieste si puede describir el arma utilizada refiere que era un arma de fuego tipo revolver color negro. - Preguntado si producto del hecho sufrio lesiones refiere que no y que tampoco requiere asistencia medica . Seguidamente se le entera y notifica del contenido de los articulos 83 al 88 del CPP. Que dan cuenta de los derechos del denunciante. Sin mas , se da por finalizada la correspondiente denuncia "                 </div>             </div>         </div>         </div>`)[0];

smo llevaba colocado un casco de color negro, detras de su auto en la calle se encontraba otro sujeto a bordo de una moto de gran cilindrada de color negra, que este masculino tambien tenia casco colocado y vestia prendas de color negro, el dicente intento acercarse hacia su auto y el sujeto que estaba en la moto le ordeno que se quede quieto, el dicente permanece quieto y estos sujetos se dan a la fuga por calle Francia con direccion hacia Av. Constitucion. Luego de lo sucedido el dicente llama al 911, haciendose presente posteriormente un movil policial. Consultado al dicente sobre las caracteristicas de los masculinos, refiere que eran dos sujetos masculinos de aproximadamente 1,75 de altura, de contextura fisica delgados, prendas de vestir de color negro, de aproximadamente 30 a 40 a√±os de edad. Consultado si de volver a ver a los masculinos lo reconoceria, refiere que NO. Consultado al dicente si resulto lesionado o golpeado, refiere que NO. Consultado al dicente si exhibieron algun tipo de arma, refiere que no observa. Consultado al deponente si en el interior del rodado tenia algo, refiere que ‚Äò‚Äòtenia su celular de marca Motorola, modelo Edge 50 Pro, de color negro, con numero de abono 2234238754 de la empresa Claro, consultad si posee sistema de rastreo, refiere que No recuerda, tambien tenia su Documento Nacional de Identidad, Licencia de Conducir, tarjeta de Credito Visa de Banco Provincia y debito de banco Provincia, tarjeta de Banco Frances Black no recuerda si es Visa o MasterCard, cedula del auto sustraido a nombre del dicente, una llave de un auto del dicente de marca Peugeot modelo 206.‚Äô‚Äô Preguntado si recuerda cuanto combustible tenia, refiere que tenia tanque completo. Consultado por si el vehiculo posee alguna caracteristica particular refiere que tiene un choque en el guardabarro posterior del lado del conductor, el dicente le coloco cinta aislante, vidrios naturales. Consultado para que manifieste cuantos juegos de llaves posee y si puede exhibir, refiere que tiene dos juegos de llaves, una la sustraida y la otra la tiene en su casa, no la exhibe. Preguntado poseia algun desperfecto mecanico, refiere que NO. Consultado si recuerda kilometraje, refiere que no recuerda. Consultado si posee sistema de rastreo satelital, refiere que ‚ÄúNO‚Äù. Preguntado si en el ultimo tiempo lo llevo a algun taller mecanico, manifiesta que ‚Äúque NO‚Äù. Preguntado si posee fotografias refiere que ‚Äò‚ÄòNO‚Äô‚Äô. Preguntado para que manifieste si sabe de la existencia de testigos refiere: ‚Äúque no habia nadie‚Äô‚Äô. Preguntado para que manifieste si en el lugar se emplazan camaras refiere que ‚Äò‚Äòun vecino le aporto las camaras de su vivineda‚Äô‚Äô. Consultado si sospecha de alguien, informa que ‚ÄúNO‚Äù. Preguntado para que manifieste si realizo cambios en la poliza de seguro refiere ‚Äò‚ÄòNO posee‚Äô‚Äô."                 </div>             </div>         </div>         </div>`)[0];

ame la ri√±onera, que yo no se la quise entregar porque habiamos salido del banco Galicia, que queda en Constitucion y Andrade y teniamos algo de dinero. Ante esta situacion este sujeto efectua un disparo que no pude ver hacia donde pero escuche la detonacion, por lo que nosotros nos resguardamos detras de una camioneta que estaba estacionada en el lugar. Motivo por el cual no pudimos ver nada, solo escuchamos que alguien dijo alto y seguidamente escuchamos las detonaciones, cuando escuchamos que se estaban retirando del lugar y pudimos salir de detras del vehiculo en el que nos resguardamos observo que la motocicleta en la que habian llegado a saber: DOMINAR 400CC, COLOR NEGRA SE ENCONTRABA APOYADA EN SU PIE EN LA CALLE, EN MARCHA Y LOS DELINCUENTES SE IBAN A BORDO DE MI MOTOCICLETA POR CALLE REMOLCADOR GUARANI HACIA CALLE Estrada. Posteriormente es que los vecinos del lugar llamaron al 911. Acto seguido se hizo presente el movil policial en el lugar. Consultado sobre si hay camaras en el lugar del hecho, refiere que si en calle Daprotis y remolcador Guarani. Consultado sobre testigos del hecho, refiere que se fueron todos cuando llego la policia, que desconoce la verdad quienes podrian haber visto algo. Preguntado si sabe quienes efectuaron las detonaciones refiere que no que no pudo ver nada, porque cuando salimos no pudimos ver quien disparaba. Preguntado si recuerda alguna caracteristica en particular del motovehiculo, refiere que su vehiculo posee una rueda de aleacion trasera, y posee una calcomania color negra en la parte trasera arriba del asiento que reza la palabra en color rojo ‚Äúmoto power‚Äù. Que solo eso despues se encuentra original de fabrica. Interrogado respecto de las caracteristicas fisonomicas y vestimenta de los autores del hecho, refiere: el acompa√±ante quien poseia el arma de fuego refiere que tenia una camperita color gris claro, que tenia un casco con visor polarizado, color negro, de contextura fisica robusto, de 1.70 metros altura aproximadamente, de tez blanca, de aproximadamente entre 25 a 30 a√±os. Y que el conductor tenia el mismo casco en cuanto a color y polarizado tambien, que tenia contextura fisica mas delgada. Examinado para que diga si se encuentra en condiciones de reconocer a los autores del hecho, relata: que si al acompa√±ante. Consultado para refiera si escucho algun tipo de tonada distinta en el habla de los sujetos, cuenta: NO. Preguntado si escucho algun tipo de apodo o forma en la que los autores se llamaran entre si, manifiesta: No, que SOLO LES HABLO EL ACOMPA√ëANTE. Interrogado si tiene el conocimiento de la existencia de camaras de seguridad en el lugar del hecho, responde: que observo en el DOMICILIO DE DAPROTIS Y REMOLCADOR GUARANI TRABAJA SU MUJER Y SABE QUE POSEE CAMARAS. Indagado respecto de la cantidad de juegos de llaves que posee del vehiculo para exhibir, REFIERE QUE NO POSEE NINGUNO EN ESTE ACTO, PERO QUE EN SU DOMICILIO POSEE UN DIUCPLICADO. Y EL ORIGINAL SE LO LLEVARON CON LA MOTO. Examinado en relacion a la cantidad de kilometros que posee su vehiculo, manifiesta: que 7700 Km aproximadamente. Preguntado cuanto poseia de combustible en su tanque, dice que 1/4 tanque aproximado de combustible NAFTA. Consultado si posee algun sistema de rastreo por geolocalizacion de su vehiculo, expresa que no posee ningun contrato de rastreador. Examinado si posee seguro y que tipo de cobertura posee, responde que tiene su vehiculo asegurado por RIO URUGUAY, poliza N¬∞ 00:20:2987777, con cobertura todo riesgo. Preguntado si en el ultimo tiempo realizo cambio de compa√±ia de seguro, responde que no que siempre tuvo el mismo. Consultado si conoce de la existencia de testigos presenciales en el lugar del hecho, responde que desconoce hasta el momento. Interrogado si su motocicleta poseia alguna falla mecanica, responde que funcionaba correctamente teniendo la VTV al dia. Indagado si posee taller mecanico que lleve su vehiculo a realizar reparaciones o servis rutinarios, responde que los servicie se los realizo yo personalmente, y que no posee taller de confianza. Examinado si poseia elementos en el interior de su motocicleta que desea aclarar, responde que una camara de moto rodado 14, y herramientas y una linga, color negra. Preguntado si realizo al momento de constatar el faltante llamado al 911, responde que si, y que se entrevisto con personal policial a bordo de un movil. Preguntado si el vehiculo posee alguna particularidad como calcomanias, polarizado y/o da√±o sobre la chapa, responde las que refirio anteriormente. Una vez realizada una amplia lectura de su denuncia, se le consulta si desea agregar algo al plexo de su declaracion, responde que No. Indagado si sufrio alguna lesion a raiz del hecho refiere que no, si tienen conocimiento que alguien haya salido herido del lugar refiere que no. Que es todo cuanto desea denunciar."                 </div>             </div>         </div>         </div>`)[0];

‚Äù, ella forcejea con el masculino por su mochila, observando que habia un segundo sujete esperando abordo de una motocicleta grande como de calle color negra, el masculino que le tripulaba tenia una visera oscura, ropa oscura y pantalon largo color gris. La denunciante cae al suelo y le arrebatan la mochila, el que estaba a pie se sube al vehiculo e intenta encenderlo, no lograndolo porque la llave de arranque tiene una forma particular para arrancar que solo la denunciante conoce. Luego de no lograr que arranque lo abandona y se retiran los dos en la motocicleta, por calle Los Naranjos en direccion a calle Ciura Brochero. Llevandose la mochila de marca Everstay de color azul, la cual contenia una computadora notebook marca Lenovo, un celular marca Motorola E20, dinero en efectivo $1.300.000 (un millon trecientos mil pesos moneda nacional) todos en fajos de billetes de $20.000 pesos, los cuales eran para pagos del mes, billetera con DNI propio y papeles varios, elementos de higiene personal. En ningun momento exhibio ningun tipo de arma. Refiere que al caerse se golpea la rodilla derecha y hombro del mismo lado producto del forcejeo, provocando solo hematomas y una patada en la costilla. Preguntada si recibio asistencia medica responde que si, en el Hospital Interzonal de Agudos Allende, preguntada si llamo al 911 responde que NO, preguntada si hay testigos del hecho responde que NO, preguntada si hay camaras en el lugar responde que NO, preguntada si Insta la Accion penal a tenor del art 72 del cpp responde que ‚ÄúSI‚Äù preguntada por las caracteristicas fisicas de los NN y si se encuentra en condiciones de reconocerlos responde que NO, era de noche no logro verlos bien. Que es todo cuanto desea denunciar."                 </div>             </div>         </div>         </div>`)[0];

                var html_ff140e94f94ce4a99ac95a87fd10db91 = $(`<div id="html_ff140e94f94ce4a99ac95a87fd10db91" style="width: 100.0%; height: 100.0%;">         <div style='font-family: Arial, sans-serif; width: 260px; color: #333;'>             <h3 style='color: #008000; margin-bottom: 0; font-size: 16px;'>Informaci√≥n del Hecho</h3>             <hr style='border: 0; border-top: 1px solid #ccc; margin: 5px 0 10px 0;'>             <table style='width: 100%; font-size: 12px; border-collapse: collapse;'>                 <tr><td style='padding: 2px;'><b>Fecha:</b></td><td>2026-02-02 00:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Hora:</b></td><td>18:30:00</td></tr>                 <tr><td style='padding: 2px;'><b>Direcci√≥n:</b></td><td>DAPROTIS 6500</td></tr>                 <tr><td style='padding: 2px;'><b>Tipo:</b></td><td>ROBO AGRAVADO  (uso de armas de fuego) - Art.166 Inc.2¬∫ p√°rr. 2do</td></tr>             </table>             <div style='margin-top: 10px;'>                 <b style='font-size: 12px;'>Detalle del Hecho:</b>                 <div style='margin-top: 5px; padding: 10px; border: 1px solid #aaa; background-color: #f9f9f9;                              font-style: italic; font-size: 11px; max-height: 100px; overflow-y: auto; line-height: 1.4;'>                     "Fecha, siendo las 19:54 hs., denuncia que resulta ser ‚Äúpropietario/conductor habitual‚Äù de vehiculo marca MONDIAL, modelo LD 110 MAX, dominio: A237VMQ colocado, color AZUL, chasis N¬∞ 8CMML11A1R2130979, motor N¬∞ CVRA00A169816. Que en el dia de la fecha, a las 18:30 horas aproximadas, refiere que se encontraba circulando por calle DAPROTIS CASI REMOLCADOR GUARANI, cuando dos sujetos masculinos, se le ponen a la par y uno de ellos, el acompa√±ante, saca de entre sus prendas un arma de fuego, tipo revolver con el que le apunta, y seguidamente me dijo dame la moto, porque lo que nos bajamos de la moto, mi se√±ora Sra. Juarez Lujan Adela y yo. Y en ese momento me solicito dame la ri√±onera, que yo no se la quise entregar porque habiamos salido del banco Galicia, que queda en Constitucion y Andrade y teniamos algo de dinero. Ante esta situacion este sujeto efectua un disparo que no pude ver hacia donde pero escuche la detonacion, por lo que nosotros nos resguardamos detras de una camioneta que estaba estacionada en el lugar. Motivo por el cual no pudimos ver nada, solo escuchamos que alguien dijo alto y seguidamente escuchamos las detonaciones, cuando escuchamos que se estaban retirando del lugar y pudimos salir de detras del vehiculo en el que nos resguardamos observo que la motocicleta en la que habian llegado a saber: DOMINAR 400CC, COLOR NEGRA SE ENCONTRABA APOYADA EN SU PIE EN LA CALLE, EN MARCHA Y LOS DELINCUENTES SE IBAN A BORDO DE MI MOTOCICLETA POR CALLE REMOLCADOR GUARANI HACIA CALLE Estrada. Posteriormente es que los vecinos del lugar llamaron al 911. Acto seguido se hizo presente el movil policial en el lugar. Consultado sobre si hay camaras en el lugar del hecho, refiere que si en calle Daprotis y remolcador Guarani. Consultado sobre testigos del hecho, refiere que se fueron todos cuando llego la policia, que desconoce la verdad quienes podrian haber visto algo. Preguntado si sabe quienes efectuaron las detonaciones refiere que no que no pudo ver nada, porque cuando salimos no pudimos ver quien disparaba. Preguntado si recuerda alguna caracteristica en particular del motovehiculo, refiere que su vehiculo posee una rueda de aleacion trasera, y posee una calcomania color negra en la parte trasera arriba del asiento que reza la palabra en color rojo ‚Äúmoto power‚Äù. Que solo eso despues se encuentra original de fabrica. Interrogado respecto de las caracteristicas fisonomicas y vestimenta de los autores del hecho, refiere: el acompa√±ante quien poseia el arma de fuego refiere que tenia una camperita color gris claro, que tenia un casco con visor polarizado, color negro, de contextura fisica robusto, de 1.70 metros altura aproximadamente, de tez blanca, de aproximadamente entre 25 a 30 a√±os. Y que el conductor tenia el mismo casco en cuanto a color y polarizado tambien, que tenia contextura fisica mas delgada. Examinado para que diga si se encuentra en condiciones de reconocer a los autores del hecho, relata: que si al acompa√±ante. Consultado para refiera si escucho algun tipo de tonada distinta en el habla de los sujetos, cuenta: NO. Preguntado si escucho algun tipo de apodo o forma en la que los autores se llamaran entre si, manifiesta: No, que SOLO LES HABLO EL ACOMPA√ëANTE. Interrogado si tiene el conocimiento de la existencia de camaras de seguridad en el lugar del hecho, responde: que observo en el DOMICILIO DE DAPROTIS Y REMOLCADOR GUARANI TRABAJA SU MUJER Y SABE QUE POSEE CAMARAS. Indagado respecto de la cantidad de juegos de llaves que posee del vehiculo para exhibir, REFIERE QUE NO POSEE NINGUNO EN ESTE ACTO, PERO QUE EN SU DOMICILIO POSEE UN DIUCPLICADO. Y EL ORIGINAL SE LO LLEVARON CON LA MOTO. Examinado en relacion a la cantidad de kilometros que posee su vehiculo, manifiesta: que 7700 Km aproximadamente. Preguntado cuanto poseia de combustible en su tanque, dice que 1/4 tanque aproximado de combustible NAFTA. Consultado si posee algun sistema de rastreo por geolocalizacion de su vehiculo, expresa que no posee ningun contrato de rastreador. Examinado si posee seguro y que tipo de cobertura posee, responde que tiene su vehiculo asegurado por RIO URUGUAY, poliza N¬∞ 00:20:2987777, con cobertura todo riesgo. Preguntado si en el ultimo tiempo realizo cambio de compa√±ia de seguro, responde que no que siempre tuvo el mismo. Consultado si conoce de la existencia de testigos presenciales en el lugar del hecho, responde que desconoce hasta el momento. Interrogado si su motocicleta poseia alguna falla mecanica, responde que funcionaba correctamente teniendo la VTV al dia. Indagado si posee taller mecanico que lleve su vehiculo a realizar reparaciones o servis rutinarios, responde que los servicie se los realizo yo personalmente, y que no posee taller de confianza. Examinado si poseia elementos en el interior de su motocicleta que desea aclarar, responde que una camara de moto rodado 14, y herramientas y una linga, color negra. Preguntado si realizo al momento de constatar el faltante llamado al 911, responde que si, y que se entrevisto con personal policial a bordo de un movil. Preguntado si el vehiculo posee alguna particularidad como calcomanias, polarizado y/o da√±o sobre la chapa, responde las que refirio anteriormente. Una vez realizada una amplia lectura de su denuncia, se le consulta si desea agregar algo al plexo de su declaracion, responde que No. Indagado si sufrio alguna lesion a raiz del hecho refiere que no, si tienen conocimiento que alguien haya salido herido del lugar refiere que no. Que es todo cuanto desea denunciar."                 </div>             </div>         </div>         </div>`)[0];

bierta de 1.70 metros de alto de contextura delgada, de tez blanca, que circulaba en su misma direccion se detiene a su derecha el acompa√±ante baja del rodado empu√±ando con su mano derecha un arma de fuego tipo pistola de color negra con desgastes en la parte superior. El dicente se percata de que estaba sucediendo, antes de mediar palabras se baja de su moto, saca la llave de forma inconsciente, y el acompa√±ante le refiere ‚Äúdame o te mato‚Äù, el dicente se da cuenta que le estaba pidiendo las llaves, le tira las llaves y sale corriendo hacia la esquina de 12 de octubre, y logra ver que ambas motos salen raudas por Lanzilota en direccion Av. Vertiz. Consultado para que manifieste si tiene documentacion del rodado refiere que SI. Consultado si posee sistema de alarma refiere que NO. Consultado si posee traba volante refiere que NO. Consultado si posee corta corrientes refiere que NO. Consultado si el rodado posee alguna caracteristica particular refiere que SI, el asiento posee una funda de color roja y negra, con dos cadenas una de color roja y la otra negra, poseia un casco enganchado con las cadenas de color blanco y rosa, del lado derecho se encontraba cubierta por calcomanias varias. Consultado si posee algun juego de llaves, refiere que NO, no posee copia. Consultado si posee algun desperfecto mecanico refiere que NO. Consultado si recuerda kilometraje, refiere que NO funciona la cuenta kilometros. Consultada si dentro del rodado poseia algun elemento de valor refiere que NO. Consultado si puede aportar fotos refiere que NO. Consultado si se comunico con emergencias 911 refiere que SI. Consultada si posee camaras de seguridad, refiere que NO. Consultada si sospecha de alguien refiere que NO. Consultada para que diga el recorrido realizado refiere toma la calle Viamontes, cruza la Av. Juan B. Justo, dobla a la izquierda por calle El Cano y nuevamente dobla a la derecha por calle Lanzilota. Consultada si posee VTV refiere que NO. Consultada si se encuentra en condiciones de reconocer, refiere que NO. Consultada si sufrio lesione prefiere que NO. Consultada si posee seguro refiere que SI, San Cristobal poliza 01-21-30117413."                 </div>             </div>         </div>         </div>`)[0];

mpa√±ante del rodado, esgrimia un arma de fuego, que no pudo ver mayores caracteristicas, mientras le decia dame todo, dame a los gritos que tampoco pudo escuchar con precision que decia, que su moto se encontraba con las llaves de ignicion colocadas. Por lo que el se hizo para atras y este sujeto se subio a su moto y se fueron por calle Valencia en direccion a la Costa. Preguntado si recuerda alguna caracteristica en particular de la moto vehiculo, refiere: que le puso unas calcomanias en el tanque de combustibles, de color negra con verde fluor que reza ‚ÄúCF MOTO 450‚Äù Y UN PORTAEQUIPAJE COLOR NEGRA CON DETALLES EN VERDE FLUOR. Interrogado respecto de las caracteristicas fisonomicas y vestimenta de los autores del hecho, refiere: que al conductor de la moto no lo vio, y el acompa√±ante era de contextura fisica delgado, de 1.70 de altura, de tez trigue√±a, de aproximadamente 20 a√±os de edad, que tenia una gorra visera color gris o negra descolorida, vestia una maya color verde, y una campera tipo rompe viento color azul con detalles rojos que no recuerda exactamente. Examinado para que diga si se encuentra en condiciones de reconocer a los autores del hecho, relata: NO, que no podria reconocerlos. Consultado para refiera si escucho algun tipo de tonada distinta en el habla de los sujetos, cuenta: que no. Preguntado si escucho algun tipo de apodo o forma en la que los autores se llamaran entre si, manifiesta: No, refiere que no hablaron entre ellos y no pudo escuchar mucho ya que el venia escuchando musica. Interrogado si tiene el conocimiento de la existencia de camaras de seguridad en el lugar del hecho, responde: refiere que si, que posteriormente las aportara. Indagado respecto de la cantidad de juegos de llaves que posee del vehiculo para exhibir, refiere que la original se la llevaron con la motocicleta y el duplicado lo tiene en su domicilio por lo que no exhibe ninguna en este acto. Examinado en relacion a la cantidad de kilometros que posee su vehiculo, manifiesta: que 2200 Km aproximadamente. Preguntado cuanto poseia de combustible en su tanque, dice que 1‚ÅÑ4 tanque aproximado de combustible Nafta. Consultado si posee algun sistema de rastreo por geolocalizacion de su vehiculo, expresa que Si posee de fabrica rastreo satelital, el cual en este momento arroja ubicacion Juan de Dios Filiberto Y Catriel, que lo siguio por este rastreador y le figura por el barrio Las Heras y despues Mario Bravo y no recuerda todo el recorrido que hicieron. Examinado si posee seguro y que tipo de cobertura posee, responde que tiene su vehiculo asegurado por SAN CRISTOBAL, poliza N¬∞ 010921300918891, con cobertura refiere robo. Preguntado si en el ultimo tiempo realizo cambio de compa√±ia de seguro, responde que no. Consultado si conoce de la existencia de testigos presenciales en el lugar del hecho, responde: que si, que habia una chica con un bebe, despues habia transeuntes ocasionales, pero no tiene sus datos filiatorios y no sabe quienes son. Interrogado si su vehiculo poseia alguna falla mecanica, responde que funcionaba correctamente teniendo la VTV al dia. Indagado si posee taller mecanico que lleve su vehiculo a realizar reparaciones o servis rutinarios, en la agencia donde la compro. Examinado si poseia elementos en el interior de su vehiculo que desea aclarar, responde que los elementos que poseia: licencia de conducir, D.N.I, tarjeta de credito VISA Y MASTERCAD, del Banco Provincia y Debito del Banco Provincia, Dos tarjetas de Mercado Pago una personal y otra del Local, llaves de su casa, y juegos de llaves de otras propiedades. Que al momento no recuerda que otra cosa pudiera tener. Preguntado si realizo al momento de constatar el faltante llamado al 911, responde que si, y que se entrevisto con personal policial a bordo de un movil. Preguntado si el vehiculo posee alguna particularidad como calcomanias, polarizado y/o da√±o sobre la chapa, responde las ya referenciadas. Una vez realizada una amplia lectura de su denuncia, se le consulta si desea agregar algo al plexo de su declaracion, responde que No. Consultado si sufrio alguna lesion con respecto al hecho,m refiere que no."                 </div>             </div>         </div>         </div>`)[0];

 se le consulta si desea agregar algo al plexo de su declaracion, responde que No. Consultado si sufrio alguna lesion con respecto al hecho,m refiere que no."                 </div>             </div>         </div>         </div>`)[0];

                var html_72d5aa030277efdd199fd0a70ef584e8 = $(`<div id="html_72d5aa030277efdd199fd0a70ef584e8" style="width: 100.0%; height: 100.0%;">         <div style='font-family: Arial, sans-serif; width: 260px; color: #333;'>             <h3 style='color: #008000; margin-bottom: 0; font-size: 16px;'>Informaci√≥n del Hecho</h3>             <hr style='border: 0; border-top: 1px solid #ccc; margin: 5px 0 10px 0;'>             <table style='width: 100%; font-size: 12px; border-collapse: collapse;'>                 <tr><td style='padding: 2px;'><b>Fecha:</b></td><td>2026-02-09 00:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Hora:</b></td><td>21:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Direcci√≥n:</b></td><td>SAN LORENZO 2069</td></tr>                 <tr><td style='padding: 2px;'><b>Tipo:</b></td><td>ROBO AGRAVADO  (uso de armas de fuego) - Art.166 Inc.2¬∫ p√°rr. 2do</td></tr>             </table>             <div style='margin-top: 10px;'>                 <b style='font-size: 12px;'>Detalle del Hecho:</b>                 <div style='margin-top: 5px; padding: 10px; border: 1px solid #aaa; background-color: #f9f9f9;                              font-style: italic; font-size: 11px; max-height: 100px; overflow-y: auto; line-height: 1.4;'>                     "En el dia de la fecha, en el horario estimado de las 21:00 horas, estaciono mi automovil sobre la trotadora de la vivienda de la calle San Lorenzo N¬∞ 2069. Cuando me encontraba descendiendo del rodado, veo que se aproximan en contra mano dos personas encapuchadas, a bordo de un motovehiculo de color rojo (desconozco si poseia chapa patente colocada). Momento en el cual se baja el sujeto que iba como acompa√±ante y esgrime un arma de fuego. Me apunta y comienza a solicitarme el rodado. No se termina de subir con el cuerpo entero, entonces yo comienzo a cerrarle la puerta a los fines que tratar de que deponga su actitud y que descienda, pero no lo logre. El sindicado aprovecha, acelera el vehiculo y colisiona contra la reja de la propiedad. En ese instante aprovecha y cierra la puerta. En un momento veo que mi mama  sale de mi casa y luego la veo caer al suelo. Ella habia confrontado con el sujeto que se encontraba en el motovehiculo, el cae y por ello la golpea y la deja tirada. Le produjo lesiones en el cuerpo. No requiere asistencia medica al momento. Se dieron a la fuga por calle Tucuman. Primero salio la moto y detras mi automovil. El rodado resultaba ser de marca Fiat Cronos de color blanco dominio AF-708OV, numero de chasis 8AP359AF2PU268836, numero de motor 552820598358305, a√±o 2022. El mismo se encuentra prendado, aun no lo termine de abonar. Todavia me quedaran aproximadamente 36 cuotas por pagar. El monto de ellas resultaban ser de $500.000. Tengo cobertura de seguro La Caja, desconozco en este momento el numero de poliza. En el interior del rodado, tenia una cartera estilo bolso de marca Astica de color gris, que contenia dos telefonos celulares, uno de marca Samsung con el abonado 2233002892 de la empresa Movistar y otro de marca Motorola no poseia chip, solo lo tenia para escuchar musica. Del primero mencionado, para ingresar tenia como sistema de bloqueo patron y mi huella dactilar. Ninguno de ellos tenia cobertura de seguro. Ademas, adentro del bolso, tenia un perfume de Natura, tres pares de anteojos de lectura, un par de anteojos de sol con aumento, una billetera de la misma marca Astica que contenia mi documento nacional de identidad, mi licencia de conducir, cedula verde del rodado, carnet de obra social Osdepym a ni nombre y de mi hija Catalina Roldan Castagno, tarjetas de credito y debito (algunas aun no estan dadas de baja), alrededor de $150.000, que resultaba ser parte de mi sueldo y reintegro de una cama ortopedica. Tambien habia oraculos de yoga, el mat de yoga, piedras energeticas, piloto de color gris, kit de seguridad del vehiculo, un de juego de llave del local ubicado en calle Rivadavia N¬∞ 5234 entre Uruguay y Marconi, el cual resulta ser un estudio de pilates y joya. En cuanto a caracteristicas del vehiculo se encontraba original de fabrica, solo que tenia un simbolo de discapacidad en el parabrisas trasero. Tiene el chapon de abajo que no es el del automovil, ya que habian cometido ilicito con anterioridad y quise protegerlo de esa manera. Tambien cuenta con dos alarmas por ese mismo motivo. Ademas del cierre centralizado. Contaba con un kilometraje aproximado de casi 20mil kilometros y tenia alrededor de medio tanque de combustible. Habia cargado nafta esta semana. En cuanto al recorrido que realice antes de estacionar en el lugar, fue: venia de calle Rivadavia y Pampa, sali de la casa de unas alumnas alrededor de 20:20 horas, el auto estaba por esta ultima arteria, entonces fui derecho hacia calle San Lorenzo. No vi que alguien me venia siguiendo. Pero siempre suelo hacer el mismo recorrido, solo a veces suelo circular por calle Alberti. El automovil era utilizado de manera habitual por mi, no tenia cedulas autorizadas. Cuando sucede el injusto, fue mi hija quien se comunico con el sistema de emergencias 911. En la cuadra no hay camaras de seguridad. No puedo aportar documentacion respaldatoria. Que es cuanto deseo denunciar al respecto, firmando al pie en conformidad."                 </div>             </div>         </div>         </div>`)[0];

                var html_b47eab3788af346f161da7dfb19f2c97 = $(`<div id="html_b47eab3788af346f161da7dfb19f2c97" style="width: 100.0%; height: 100.0%;">         <div style='font-family: Arial, sans-serif; width: 260px; color: #333;'>             <h3 style='color: #008000; margin-bottom: 0; font-size: 16px;'>Informaci√≥n del Hecho</h3>             <hr style='border: 0; border-top: 1px solid #ccc; margin: 5px 0 10px 0;'>             <table style='width: 100%; font-size: 12px; border-collapse: collapse;'>                 <tr><td style='padding: 2px;'><b>Fecha:</b></td><td>2026-02-09 00:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Hora:</b></td><td>21:00:00</td></tr>                 <tr><td style='padding: 2px;'><b>Direcci√≥n:</b></td><td>SAN LORENZO 2069</td></tr>                 <tr><td style='padding: 2px;'><b>Tipo:</b></td><td>ROBO AGRAVADO  (uso de armas de fuego) - Art.166 Inc.2¬∫ p√°rr. 2do</td></tr>             </table>             <div style='margin-top: 10px;'>                 <b style='font-size: 12px;'>Detalle del Hecho:</b>                 <div style='margin-top: 5px; padding: 10px; border: 1px solid #aaa; background-color: #f9f9f9;                              font-style: italic; font-size: 11px; max-height: 100px; overflow-y: auto; line-height: 1.4;'>                     "En el dia de la fecha, en el horario estimado de las 21:00 horas, estaciono mi automovil sobre la trotadora de la vivienda de la calle San Lorenzo N¬∞ 2069. Cuando me encontraba descendiendo del rodado, veo que se aproximan en contra mano dos personas encapuchadas, a bordo de un motovehiculo de color rojo (desconozco si poseia chapa patente colocada). Momento en el cual se baja el sujeto que iba como acompa√±ante y esgrime un arma de fuego. Me apunta y comienza a solicitarme el rodado. No se termina de subir con el cuerpo entero, entonces yo comienzo a cerrarle la puerta a los fines que tratar de que deponga su actitud y que descienda, pero no lo logre. El sindicado aprovecha, acelera el vehiculo y colisiona contra la reja de la propiedad. En ese instante aprovecha y cierra la puerta. En un momento veo que mi mama  sale de mi casa y luego la veo caer al suelo. Ella habia confrontado con el sujeto que se encontraba en el motovehiculo, el cae y por ello la golpea y la deja tirada. Le produjo lesiones en el cuerpo. No requiere asistencia medica al momento. Se dieron a la fuga por calle Tucuman. Primero salio la moto y detras mi automovil. El rodado resultaba ser de marca Fiat Cronos de color blanco dominio AF-708OV, numero de chasis 8AP359AF2PU268836, numero de motor 552820598358305, a√±o 2022. El mismo se encuentra prendado, aun no lo termine de abonar. Todavia me quedaran aproximadamente 36 cuotas por pagar. El monto de ellas resultaban ser de $500.000. Tengo cobertura de seguro La Caja, desconozco en este momento el numero de poliza. En el interior del rodado, tenia una cartera estilo bolso de marca Astica de color gris, que contenia dos telefonos celulares, uno de marca Samsung con el abonado 2233002892 de la empresa Movistar y otro de marca Motorola no poseia chip, solo lo tenia para escuchar musica. Del primero mencionado, para ingresar tenia como sistema de bloqueo patron y mi huella dactilar. Ninguno de ellos tenia cobertura de seguro. Ademas, adentro del bolso, tenia un perfume de Natura, tres pares de anteojos de lectura, un par de anteojos de sol con aumento, una billetera de la misma marca Astica que contenia mi documento nacional de identidad, mi licencia de conducir, cedula verde del rodado, carnet de obra social Osdepym a ni nombre y de mi hija Catalina Roldan Castagno, tarjetas de credito y debito (algunas aun no estan dadas de baja), alrededor de $150.000, que resultaba ser parte de mi sueldo y reintegro de una cama ortopedica. Tambien habia oraculos de yoga, el mat de yoga, piedras energeticas, piloto de color gris, kit de seguridad del vehiculo, un de juego de llave del local ubicado en calle Rivadavia N¬∞ 5234 entre Uruguay y Marconi, el cual resulta ser un estudio de pilates y joya. En cuanto a caracteristicas del vehiculo se encontraba original de fabrica, solo que tenia un simbolo de discapacidad en el parabrisas trasero. Tiene el chapon de abajo que no es el del automovil, ya que habian cometido ilicito con anterioridad y quise protegerlo de esa manera. Tambien cuenta con dos alarmas por ese mismo motivo. Ademas del cierre centralizado. Contaba con un kilometraje aproximado de casi 20mil kilometros y tenia alrededor de medio tanque de combustible. Habia cargado nafta esta semana. En cuanto al recorrido que realice antes de estacionar en el lugar, fue: venia de calle Rivadavia y Pampa, sali de la casa de unas alumnas alrededor de 20:20 horas, el auto estaba por esta ultima arteria, entonces fui derecho hacia calle San Lorenzo. No vi que alguien me venia siguiendo. Pero siempre suelo hacer el mismo recorrido, solo a veces suelo circular por calle Alberti. El automovil era utilizado de manera habitual por mi, no tenia cedulas autorizadas. Cuando sucede el injusto, fue mi hija quien se comunico con el sistema de emergencias 911. En la cuadra no hay camaras de seguridad. No puedo aportar documentacion respaldatoria. Que es cuanto deseo denunciar al respecto, firmando al pie en conformidad."                 </div>             </div>         </div>         </div>`)[0];

 Dando cuenta que el acompa√±ante del motovehiculo al descender lo apunta con un arma de fuego tipo revolver o pistola refiriendole a viva voz ‚ÄúQuedate quieto porque estas muerto‚Äù, tomandolo del brazo para sacarlo del vehiculo. Ante lo expuesto el dicente refiere que sale de su vehiculo, cayendose al suelo. Dando cuenta que este masculino se sube a su rodado y lo desapodera de su bien, dandose a la fuga ambos vehiculos por calle Francia hacia calle Necochea. Ante consulta si llamo al 911 misma responde (SIC) ‚ÄúMi pareja Maria Alejandra Cametti llamo al 911, desde su telefono 2235983294. Yo de ahi me vine hacer la denuncia en la comisaria y cuando se hizo presente el movil policial entrevisto con Maria.‚Äù Ante consulta si requirio asistencia medica misma responde (SIC) ‚ÄúNo, pero tengo una lesion en mi rodilla izquierda producto de la caida en la vereda‚Äù Ante consulta si estaria en condiciones de reconocer a los masculinos en caso de volver a verlos misma responde (SIC) ‚ÄúNo, estaria en condiciones de reconocerlos. Solo puedo decir que eral jovenes y delgados, tendrian unos 20 a√±os como mucho. Pero no recuerdo mas que eso fue todo muy rapido.‚Äù Ante consulta por el arma de fuego mismo responde (SIC) ‚ÄúSe que me apunto con un arma, pero no llegue a verla. Seria tipo revolver o pistola.‚Äù Ante consulta si tiene conocimiento de la existencia de camaras ya sean privadas o del com misma responde (SIC) ‚ÄúNosotros no tenemos camaras de seguridad, pero los dos vecinos tienen camaras. si consigo el soporte filmico lo aporto a la brevedad.‚Äù Ante consultas por los elementos sustraidos misma responde (SIC) ‚Äúnada de valor, dos reposeras y algun elemento personal.‚Äù Consultado  para que manifieste si posee la documentacion del rodado, misma exhibe y aporta copia de CEDULA VERDE- LICENCIA DE CONDUCIR Y CONSTANCIA DE SEGURO TODO A NOMBRE DEL DENUNCIANTE TOMAS ADRIAN ALBERTO DNI 12.516.161.‚Äù Consultado por si el vehiculo posee alguna caracteristica particular, refiere que: ‚ÄúLo que tiene sus vidrios laterales y de la luneta estan polarizados‚Äù. Preguntado poseia algun desperfecto mecanico, refiere que ‚ÄúNO‚Äù. Consultado si recuerda kilometraje refiere que 66.000 km aproximadamente. Preguntado si en el ultimo tiempo lo llevo a algun taller mecanico, manifiesta que ‚ÄúSi, a la casa de Volkswagen el que esta en calle Las Heras y Juan B Justo un tema de chaperio. Tenia turno para el 2 de marzo de 2026 para hacerle el service‚Äù Preguntado si posee fotografias refiere:‚ÄúNO‚Äù. Ante consulta por el combustible que utiliza y si recuerda cuanto poseia en el tanque misma responde (SIC) ‚ÄúUsa solo nafta y tenia un cuarto de tanque.‚Äù Consultado si sospecha de alguien, informa que ‚ÄúNo‚Äù. Preguntado para que manifieste si realizo cambios en la poliza de seguro refiere: ‚ÄúNo‚Äù Seguidamente se le entera y notifica del contenido de los articulos 83 al 88 del CPP., que hace entrega copia derechos vtma a tenor ley 15232. Que es cuanto desea declarar. No siendo para mas el acto. Se lee, ratifica y firma para legal constancia."                 </div>             </div>         </div>         </div>`)[0];
